export function handleSignup() {
    // 비밀번호와 비밀번호 확인 일치 여부 확인
    if (this.signupData.password !== this.signupData.confirmPassword) {
        alert('비밀번호가 일치하지 않습니다.');
        return;
    }

    // 회원가입 로직 구현 (예: 서버에 회원가입 요청 보내기)
    console.log('회원가입 시도 중...', this.signupData);
    // 예시로, ngrok의 백엔드 서버로 회원가입 요청 보내기
    fetch('https://d5bf569728f0.ngrok.app/api/signup/', {
        method: 'POST',
        headers: {
            'Content-Type': 'application/json'
        },
        body: JSON.stringify(this.signupData)
    })
    .then(response => {
        if (!response.ok) {
            throw new Error(`HTTP error! status: ${response.status}`);
        }
        return response.json();
    })
    .then(data => {
        if (data.success) {
            console.log('회원가입 성공:', data);
            // 회원가입 성공 후 동작 (예: 로그인 페이지로 이동)
            this.$router.push('/login');
        } else {
            console.error('회원가입 실패:', data.message);
            alert('회원가입 실패: ' + data.message);
        }
    })
    .catch(error => {
        console.error('회원가입 에러:', error);
        alert('회원가입 에러: ' + error.message);
    });
}


export function redirectToLogin() {
    // 로그인 페이지로 리다이렉트
    console.log('로그인 페이지로 이동');
    // 실제 구현에서는 라우터를 사용하여 페이지 이동
    this.$router.push('/login');
}
